import React, { useEffect, useState } from 'react';
import { LaunchDarklyApi } from '../launchdarkly/LaunchDarklyApi';
import { LaunchDarkly } from '../launchdarkly/LaunchDarkly';

function HomePage() {

    const [ldItems, setLdItems] = useState<LaunchDarkly>();

    const handleClick = async () => {
        const data = await LaunchDarklyApi.get('default', 'test');
        setLdItems(new LaunchDarkly(data));
        console.log('data ne', ldItems);
    }

    useEffect(() => {
        async function loadProjects() {
            try {
                const data = await LaunchDarklyApi.get('default', 'test');
                setLdItems(new LaunchDarkly(data));
            } catch (e) {
                if (e instanceof Error) {
                  console.log(e.message);
                }
            } 
        }
        loadProjects();
    }, []);

    return (
        <>
            <button className="bordered" onClick={ handleClick }>
                <span className="icon-edit "></span>
                Edit
            </button>
            {
            ldItems?.items?.length != 0 && (
                <div>
                    <span className="spinner primary"></span>
                    <p>Loading...</p>
                </div>
            )}
        </>
    );
}

export default HomePage;
